import React from 'react';

function BrandBoard() {
  // Example brand data
  const brands = [
    { id: 1, name: 'Brand A', logo: 'brand-a-logo.png' },
    { id: 2, name: 'Brand B', logo: 'brand-b-logo.png' },
    { id: 3, name: 'Brand C', logo: 'brand-c-logo.png' },
    // Add more brands here
  ];

  return (
    <div className='brand-board-main'>
      <h2>Featured Brands</h2>
      <div className='brand-list'>
        {brands.map(brand => (
          <div className='brand' key={brand.id}>
            <img src={brand.logo} alt={brand.name} />
            <p>{brand.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default BrandBoard;
